import React from "react";

export default class GetShoppingList extends React.Component {
 constructor(props){
   super(props);
   this.state = {
    shoppingList: []
   }
 }
async myFunc() {
 fetch("/showBasket")
 .then(response => response.json())
 .then(data => this.setState({
   shoppingList :data}))
 .then(data => console.log(this.state.shoppingList))
}
myFunc2() {
 // this.state.firstSate[0].map(house => console.log(house.playername) );
 console.log(this.state.shoppingList[0].id);
}
render() {
      return (
         <div>
         <h1>FIFA 20 Ultimate Team Squad Builder</h1>
         <div>
         <button onClick={() => this.myFunc()}>Load Players</button>
         </div>
